import React from 'react';
import './Navbar.css'; // Make sure to create a corresponding CSS file for styling

const Navbar = () => {
  return (
    <nav className="navbar">
      <ul className="nav-links">
        <li className="nav-item"><a href="#home">Home</a></li>
        <li className="nav-item"><a href="#about">About</a></li>
        <li className="nav-item"><a href="#programs">Programs</a></li>
        <li className="nav-item"><a href="#shop">Shop</a></li>
        <li className="nav-item"><a href="#blog">Blog</a></li>
        <li className="nav-item"><a href="#contact">Contact Us</a></li>
      </ul>
    </nav>
  );
}

export default Navbar;
